    /******************************************************************************
     * principal_lupMain
     ******************************************************************************/
    /**
     *
     * TODO_javadoc.
     *
     * @return TODO_javadoc.
     *
     */
    public String principal_lupMain() {

        logger.debug("entrando a 'principal_lupMain()' ...");

        if (scrVari.getScrInst().equals(scrCtts.getScrInstHcm())) {

            execute("scrCom");
        }

        if (scrVari.getScrCrpf().getScrCcpp().equals("MOD")) {

            execute("scrMod");
        }
        else {

            if (scrVari.getScrCrpf().getScrCcpp().equals("ING")) {

                execute("scrIng");
            }
            else {

                if (scrVari.getScrCrpf().getScrCcpp().equals("ACC")) {

                    execute("scrAcc");
                }
                else {

                    if (scrVari.getScrCrpf().getScrCcpp().equals("ELI")) {

                        execute("scrEli");
                    }
                    else {

                        if (scrVari.getScrCrpf().getScrCcpp().equals("ACT")) {

                            execute("scrAct");
                        }
                        else {

                            if (scrVari.getScrCrpf().getScrCcpp().equals("PGM")) {

                                execute("scrPgm");
                            }
                            else {

                                //// setters /////////////////////////////////////////////////////////////////////////////////
                                //scrVari.setScrInst("   ");
                                //scrCtts.setScrInstHcm("   ");
                                //////////////////////////////////////////////////////////////////////////////////////////////
                                logger.debug("MOVE SCR-INST-HCM TO SCR-INST");

                                scrVari.setScrInst(scrCtts.getScrInstHcm());

                                logger.debug("scrVari.getScrInst() :" + scrVari.getScrInst());
                                logger.debug("scrCtts.getScrInstHcm() :" + scrCtts.getScrInstHcm());
                            }
                        }
                    }
                }
            }
        }
        logger.debug("GO TO LUP-MAIN");


        logger.debug("saliendo de 'principal_lupMain()' ...");
        return "principal_lupMain";
    }

