    /******************************************************************************
     * scrIng_iniScrIng
     ******************************************************************************/
    /**
     *
     * TODO_javadoc.
     *
     * @return TODO_javadoc.
     *
     */
    public String scrIng_iniScrIng() {

        logger.debug("entrando a 'scrIng_iniScrIng()' ...");

        if (scrVari.getScrInst().equals(scrCtts.getScrInstHky())) {

            execute("hblIky");

            //// setters /////////////////////////////////////////////////////////////////////////////////
            //scrVari.setScrInst("   ");
            //scrCtts.setScrInstGky("   ");
            //////////////////////////////////////////////////////////////////////////////////////////////
            logger.debug("MOVE SCR-INST-GKY TO SCR-INST");

            scrVari.setScrInst(scrCtts.getScrInstGky());

            logger.debug("scrVari.getScrInst() :" + scrVari.getScrInst());
            logger.debug("scrCtts.getScrInstGky() :" + scrCtts.getScrInstGky());

            if (!scrVari.isScrOfrmSrv()) {

                execute("scrDmsg");
            }
            else {

                execute("scrPuta");
            }
        }
        else {

            if (scrVari.getScrInst().equals(scrCtts.getScrInstGky())) {

                execute("scrRst");

                execute("getIky");

                if (!frmVari.isFrmStatAbt()) {

                    //// setters /////////////////////////////////////////////////////////////////////////////////
                    //frmVari.setFrmMens("                                                                               ");
                    //////////////////////////////////////////////////////////////////////////////////////////////
                    logger.debug("MOVE SPACES TO FRM-MENS");

                    frmVari.setFrmMens(Util.spaces(79));

                    logger.debug("frmVari.getFrmMens() :" + frmVari.getFrmMens());

                    execute("fndKey");

                    if (!fioVari.getFioStat().isFioStatOks() && !fioVari.getFioStat().getValue().equals(fioCtts.getFioStatNex())) {

                        //// setters /////////////////////////////////////////////////////////////////////////////////
                        //pgmVari.setPgmIclr(" ");
                        //pgmVari.setPgmLimpiarTodo(" ");
                        //////////////////////////////////////////////////////////////////////////////////////////////
                        logger.debug("MOVE PGM-LIMPIAR-TODO TO PGM-ICLR");

                        pgmVari.setPgmIclr(pgmVari.getPgmLimpiarTodo());

                        logger.debug("pgmVari.getPgmIclr() :" + pgmVari.getPgmIclr());
                        logger.debug("pgmVari.getPgmLimpiarTodo() :" + pgmVari.getPgmLimpiarTodo());

                        execute("scrTrl");
                    }
                    else {

                        //// setters /////////////////////////////////////////////////////////////////////////////////
                        //scrVari.setScrIerr(" ");
                        //////////////////////////////////////////////////////////////////////////////////////////////
                        logger.debug("MOVE 'S' TO SCR-IERR");

                        scrVari.setScrIerr("S");

                        logger.debug("scrVari.getScrIerr() :" + scrVari.getScrIerr());

                        //// setters /////////////////////////////////////////////////////////////////////////////////
                        //pgmVari.setPgmIclr(" ");
                        //pgmVari.setPgmLimpiarCampos(" ");
                        //////////////////////////////////////////////////////////////////////////////////////////////
                        logger.debug("MOVE PGM-LIMPIAR-CAMPOS TO PGM-ICLR");

                        pgmVari.setPgmIclr(pgmVari.getPgmLimpiarCampos());

                        logger.debug("pgmVari.getPgmIclr() :" + pgmVari.getPgmIclr());
                        logger.debug("pgmVari.getPgmLimpiarCampos() :" + pgmVari.getPgmLimpiarCampos());

                        if (frmVari.getFrmMens().compareTo(Util.spaces(79)) <= 0) {

                            //// setters /////////////////////////////////////////////////////////////////////////////////
                            //msg.getMsgKeyIreg().getMsgKy0Tabs().getMsgCodTabl().getMsgCodMens().setValue("            ");
                            //////////////////////////////////////////////////////////////////////////////////////////////
                            logger.debug("MOVE 'REGEXI    ' TO MSG-COD-MENS");

                            msg.getMsgKeyIreg().getMsgKy0Tabs().getMsgCodTabl().getMsgCodMens().setValue("REGEXI    ");

                            logger.debug("msg.getMsgKeyIreg().getMsgKy0Tabs().getMsgCodTabl().getMsgCodMens().getValue() :" + msg.getMsgKeyIreg().getMsgKy0Tabs().getMsgCodTabl().getMsgCodMens().getValue());

                            //// setters /////////////////////////////////////////////////////////////////////////////////
                            //msgVari.getMsgGlsFmsg().setMsgCodSist("   ");
                            //////////////////////////////////////////////////////////////////////////////////////////////
                            logger.debug("MOVE 'GNS' TO MSG-COD-SIST");

                            msgVari.getMsgGlsFmsg().setMsgCodSist("GNS");

                            logger.debug("msgVari.getMsgGlsFmsg().getMsgCodSist() :" + msgVari.getMsgGlsFmsg().getMsgCodSist());

                            execute("getMsg");

                            //// setters /////////////////////////////////////////////////////////////////////////////////
                            //frmVari.setFrmMens("                                                                               ");
                            //msg.getMsgGlsDesc().setValue("                                        ");
                            //////////////////////////////////////////////////////////////////////////////////////////////
                            logger.debug("MOVE MSG-GLS-DESC TO FRM-MENS");

                            frmVari.setFrmMens(msg.getMsgGlsDesc().getValue());

                            logger.debug("frmVari.getFrmMens() :" + frmVari.getFrmMens());
                            logger.debug("msg.getMsgGlsDesc().getValue() :" + msg.getMsgGlsDesc().getValue());

                            execute("scrMssg");

                            //// setters /////////////////////////////////////////////////////////////////////////////////
                            //scrVari.setScrStat(" ");
                            //scrCtts.setScrStatAbt(" ");
                            //////////////////////////////////////////////////////////////////////////////////////////////
                            logger.debug("MOVE SCR-STAT-ABT TO SCR-STAT");

                            scrVari.setScrStat(scrCtts.getScrStatAbt());

                            logger.debug("scrVari.getScrStat() :" + scrVari.getScrStat());
                            logger.debug("scrCtts.getScrStatAbt() :" + scrCtts.getScrStatAbt());

                            execute("desscrtrl");
                            logger.debug("GO TO FIN-SCR-ING");


                            logger.debug("saliendo de 'scrIng_iniScrIng()' ...");
                            return "scrIng_finScrIng";
                        }
                        else {

                            execute("scrMssg");

                            //// setters /////////////////////////////////////////////////////////////////////////////////
                            //scrVari.setScrStat(" ");
                            //scrCtts.setScrStatAbt(" ");
                            //////////////////////////////////////////////////////////////////////////////////////////////
                            logger.debug("MOVE SCR-STAT-ABT TO SCR-STAT");

                            scrVari.setScrStat(scrCtts.getScrStatAbt());

                            logger.debug("scrVari.getScrStat() :" + scrVari.getScrStat());
                            logger.debug("scrCtts.getScrStatAbt() :" + scrCtts.getScrStatAbt());

                            execute("desscrtrl");
                            logger.debug("GO TO FIN-SCR-ING");


                            logger.debug("saliendo de 'scrIng_iniScrIng()' ...");
                            return "scrIng_finScrIng";
                        }
                    }
                }
                else {

                    //// setters /////////////////////////////////////////////////////////////////////////////////
                    //frmVari.setFrmMens("                                                                               ");
                    //////////////////////////////////////////////////////////////////////////////////////////////
                    logger.debug("MOVE SPACES TO FRM-MENS");

                    frmVari.setFrmMens(Util.spaces(79));

                    logger.debug("frmVari.getFrmMens() :" + frmVari.getFrmMens());

                    execute("scrMssg");

                    execute("desscrtrl");
                    logger.debug("GO TO FIN-SCR-ING");


                    logger.debug("saliendo de 'scrIng_iniScrIng()' ...");
                    return "scrIng_finScrIng";
                }
            }
            else {

                if (scrVari.getScrInst().equals(scrCtts.getScrInstGab())) {

                    execute("getCon");
                }
            }
        }

        execute("desscrtrl");

        logger.debug("saliendo de 'scrIng_iniScrIng()' ...");

        return "scrIng_msgScrIng";
    }

