    public String scrEli_iniScrEli() {

        logger.debug("entrando a 'scrEli_iniScrEli()' ...");

        if (scrVari.getScrInst().equals(scrCtts.getScrInstHky())) {

            execute("hblKey");

            //// setters /////////////////////////////////////////////////////////////////////////////////
            //scrVari.setScrInst("   ");
            //scrCtts.setScrInstGky("   ");
            //////////////////////////////////////////////////////////////////////////////////////////////
            logger.debug("MOVE SCR-INST-GKY TO SCR-INST");

            scrVari.setScrInst(scrCtts.getScrInstGky());

            logger.debug("scrVari.getScrInst() :" + scrVari.getScrInst());
            logger.debug("scrCtts.getScrInstGky() :" + scrCtts.getScrInstGky());

            execute("scrDmsg");
        }
        else {

            if (scrVari.getScrInst().equals(scrCtts.getScrInstGky())) {

                execute("scrKey");

                if (!scrVari.getScrStat().equals(scrCtts.getScrStatAbt())) {

                    execute("scrTrl");
                }
                else {

                    execute("desscrtrl");
                    logger.debug("GO TO FIN-SCR-ELI");


                    logger.debug("saliendo de 'scrEli_iniScrEli()' ...");
                    return "scrEli_finScrEli";
                }
            }
            else {

                if (scrVari.getScrInst().equals(scrCtts.getScrInstGab())) {

                    execute("getCon");
                }
                else {

                    if (scrVari.getScrInst().equals(scrCtts.getScrInstBrw())) {

                        //// setters /////////////////////////////////////////////////////////////////////////////////
                        //frmVari.setFrmFfld(" ");
                        //scrVari.setScrFfld(" ");
                        //////////////////////////////////////////////////////////////////////////////////////////////
                        logger.debug("MOVE SCR-FFLD TO FRM-FFLD");

                        frmVari.setFrmFfld(scrVari.getScrFfld());

                        logger.debug("frmVari.getFrmFfld() :" + frmVari.getFrmFfld());
                        logger.debug("scrVari.getScrFfld() :" + scrVari.getScrFfld());

                        execute("brwScrEli");
                    }
                }
            }
        }

        execute("desscrtrl");

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //frmVari.setFrmMens("                                                                               ");
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("MOVE SPACES TO FRM-MENS");

        frmVari.setFrmMens(Util.spaces(79));

        logger.debug("frmVari.getFrmMens() :" + frmVari.getFrmMens());

        execute("scrMssg");

        logger.debug("saliendo de 'scrEli_iniScrEli()' ...");

        return "scrEli_finScrEli";
    }

