                execute("getMsg");

                //// setters /////////////////////////////////////////////////////////////////////////////////
                //frmVari.setFrmMens("                                                                               ");
                //msg.getMsgGlsDesc().setValue("                                        ");
                //////////////////////////////////////////////////////////////////////////////////////////////
