    public String valIkyCic_iniValIkyCic() {

        logger.debug("entrando a 'valIkyCic_iniValIkyCic()' ...");

        execute("valCicCodTcic");

        if (frmVari.getFrmSuar().equals(frmCtts.getFrmSuarMal()) || frmVari.getFrmSuar().equals(frmCtts.getFrmSuarClr())) {

            //// setters /////////////////////////////////////////////////////////////////////////////////
            //cicFld.setCicCodTcicLen(0);
            //frmCtts.setFrmIndErro(0);
            //////////////////////////////////////////////////////////////////////////////////////////////
            logger.debug("MOVE FRM-IND-ERRO TO CIC-COD-TCIC-LEN IN CIC-FLD");

            cicFld.setCicCodTcicLen(frmCtts.getFrmIndErro());

            logger.debug("cicFld.getCicCodTcicLen() :" + cicFld.getCicCodTcicLen());
            logger.debug("frmCtts.getFrmIndErro() :" + frmCtts.getFrmIndErro());
            logger.debug("GO TO FIN-VAL-IKY-CIC");


            logger.debug("saliendo de 'valIkyCic_iniValIkyCic()' ...");
            return "valIkyCic_finValIkyCic";
        }

        execute("valCicCodCcic");

        if (frmVari.getFrmSuar().equals(frmCtts.getFrmSuarMal()) || frmVari.getFrmSuar().equals(frmCtts.getFrmSuarClr())) {

            //// setters /////////////////////////////////////////////////////////////////////////////////
            //cicFld.setCicCodCcicLen(0);
            //frmCtts.setFrmIndErro(0);
            //////////////////////////////////////////////////////////////////////////////////////////////
            logger.debug("MOVE FRM-IND-ERRO TO CIC-COD-CCIC-LEN IN CIC-FLD");

            cicFld.setCicCodCcicLen(frmCtts.getFrmIndErro());

            logger.debug("cicFld.getCicCodCcicLen() :" + cicFld.getCicCodCcicLen());
            logger.debug("frmCtts.getFrmIndErro() :" + frmCtts.getFrmIndErro());
            logger.debug("GO TO FIN-VAL-IKY-CIC");


            logger.debug("saliendo de 'valIkyCic_iniValIkyCic()' ...");
            return "valIkyCic_finValIkyCic";
        }

        logger.debug("saliendo de 'valIkyCic_iniValIkyCic()' ...");

        return "valIkyCic_finValIkyCic";
    }

