    /******************************************************************************
     * valNumFldCic_valNumCicNumIcic
     ******************************************************************************/
    /**
     *
     * TODO_javadoc.
     *
     * @return TODO_javadoc.
     *
     */
    public String valNumFldCic_valNumCicNumIcic() {

        logger.debug("entrando a 'valNumFldCic_valNumCicNumIcic()' ...");

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //numVari.setNumNume("                         ");
        //cicFld.setCicNumIcicAlf("        ");
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("MOVE CIC-NUM-ICIC-ALF IN CIC-FLD TO NUM-NUME");

        numVari.setNumNume(cicFld.getCicNumIcicAlf());

        logger.debug("numVari.getNumNume() :" + numVari.getNumNume());
        logger.debug("cicFld.getCicNumIcicAlf() :" + cicFld.getCicNumIcicAlf());

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //numVari.getNumCndv().setNumZero(0);
        //numCtts.setNumZeroS(0);
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("MOVE NUM-ZERO-S TO NUM-ZERO");

        numVari.getNumCndv().setNumZero(numCtts.getNumZeroS());

        logger.debug("numVari.getNumCndv().getNumZero() :" + numVari.getNumCndv().getNumZero());
        logger.debug("numCtts.getNumZeroS() :" + numCtts.getNumZeroS());

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //numVari.getNumCndv().setNumSgno(0);
        //numCtts.setNumSgnoN(0);
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("MOVE NUM-SGNO-N TO NUM-SGNO");

        numVari.getNumCndv().setNumSgno(numCtts.getNumSgnoN());

        logger.debug("numVari.getNumCndv().getNumSgno() :" + numVari.getNumCndv().getNumSgno());
        logger.debug("numCtts.getNumSgnoN() :" + numCtts.getNumSgnoN());

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //numVari.getNumCndv().setNumNent(0);
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("MOVE 8 TO NUM-NENT");

        numVari.getNumCndv().setNumNent(8);

        logger.debug("numVari.getNumCndv().getNumNent() :" + numVari.getNumCndv().getNumNent());

        //// setters /////////////////////////////////////////////////////////////////////////////////
        //numVari.getNumCndv().setNumNdcm(0);
        //////////////////////////////////////////////////////////////////////////////////////////////
        logger.debug("MOVE 0 TO NUM-NDCM");

        numVari.getNumCndv().setNumNdcm(0);

        logger.debug("numVari.getNumCndv().getNumNdcm() :" + numVari.getNumCndv().getNumNdcm());

        execute("valNum");

        if (numVari.isNumStatOks()) {

            //// setters /////////////////////////////////////////////////////////////////////////////////
            //cicFld.setCicNumIcic(0);
            //numVari.getNumNumv().setNumNn9n(0D);
            //////////////////////////////////////////////////////////////////////////////////////////////
            logger.debug("MOVE NUM-NN9N TO CIC-NUM-ICIC IN CIC-FLD");

            cicFld.setCicNumIcic((int) numVari.getNumNumv().getNumNn9n());

            logger.debug("cicFld.getCicNumIcic() :" + cicFld.getCicNumIcic());
            logger.debug("numVari.getNumNumv().getNumNn9n() :" + numVari.getNumNumv().getNumNn9n());
        }
        else {

            //// setters /////////////////////////////////////////////////////////////////////////////////
            //frmVari.setFrmMens("                                                                               ");
            //numVari.setNumMens("                                                                               ");
            //////////////////////////////////////////////////////////////////////////////////////////////
            logger.debug("MOVE NUM-MENS TO FRM-MENS");

            frmVari.setFrmMens(numVari.getNumMens());

            logger.debug("frmVari.getFrmMens() :" + frmVari.getFrmMens());
            logger.debug("numVari.getNumMens() :" + numVari.getNumMens());

            //// setters /////////////////////////////////////////////////////////////////////////////////
            //frmVari.setFrmSuar("   ");
            //frmCtts.setFrmSuarMal("   ");
            //////////////////////////////////////////////////////////////////////////////////////////////
            logger.debug("MOVE FRM-SUAR-MAL TO FRM-SUAR");

            frmVari.setFrmSuar(frmCtts.getFrmSuarMal());

            logger.debug("frmVari.getFrmSuar() :" + frmVari.getFrmSuar());
            logger.debug("frmCtts.getFrmSuarMal() :" + frmCtts.getFrmSuarMal());

            //// setters /////////////////////////////////////////////////////////////////////////////////
            //cicFld.setCicNumIcicLen(0);
            //////////////////////////////////////////////////////////////////////////////////////////////
            logger.debug("MOVE - 9 TO CIC-NUM-ICIC-LEN IN CIC-FLD");

            cicFld.setCicNumIcicLen(-9);

            logger.debug("cicFld.getCicNumIcicLen() :" + cicFld.getCicNumIcicLen());
            logger.debug("GO TO FIN-VAL-NUM-FLD-CIC");


            logger.debug("saliendo de 'valNumFldCic_valNumCicNumIcic()' ...");
            return "valNumFldCic_finValNumFldCic";
        }

        logger.debug("saliendo de 'valNumFldCic_valNumCicNumIcic()' ...");

        return "valNumFldCic_finValNumFldCic";
    }

